import React from "react";
import Button from 'react-bootstrap/Button';
import {contextName} from "./contextAPI"

const Btn = () => {

return (
       <contextName.Consumer>
            {({name, setName}) => {
                setName()
                return (
                <div>
                            <h2>componenet 1 : {name} </h2>
                </div>
                )
            }}
       </contextName.Consumer>
    )
}

export default Btn
